import React from 'react';

export default function TemplatesTab() {
  return (
    <div className="w-full max-w-5xl mx-auto py-12">
      <h2 className="text-3xl font-bold text-gray-100 mb-8 text-center">Templates</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
        {[1,2,3].map((i) => (
          <div key={i} className="bg-black/30 backdrop-blur-lg rounded-2xl border border-zinc-500/40 shadow-xl p-8 flex flex-col gap-2">
            <h3 className="text-xl font-bold text-white">Aggro Sniper</h3>
            <div className="flex gap-2 text-xs mb-2">
              <span className="bg-zinc-800 text-gray-300 rounded px-2 py-0.5">Beginner</span>
              <span className="bg-zinc-800 text-gray-300 rounded px-2 py-0.5">GambleFi</span>
              <span className="bg-zinc-800 text-gray-300 rounded px-2 py-0.5">MemeCoin</span>
            </div>
            <p className="text-gray-300 text-sm mb-2">High wallet overlap and 150% volume spike</p>
            <div className="flex items-center gap-2 text-xs text-green-400 mb-2">ROI: 32% <span className="text-gray-400">â€¢</span> Win Rate: 68%</div>
            <button className="mt-auto px-4 py-2 rounded bg-zinc-800 border border-gray-600 text-sm text-white hover:bg-zinc-700 transition">Try Flow</button>
          </div>
        ))}
      </div>
    </div>
  );
}
